import{_ as t,c as i,ah as a,o}from"./chunks/framework.BWXOFiC5.js";const m=JSON.parse('{"title":"Autotask","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/Integrations/autotask.md","filePath":"Documentation/Integrations/autotask.md"}'),r={name:"Documentation/Integrations/autotask.md"};function n(s,e,l,u,c,d){return o(),i("div",null,e[0]||(e[0]=[a('<h1 id="autotask" tabindex="-1">Autotask <a class="header-anchor" href="#autotask" aria-label="Permalink to &quot;Autotask&quot;">​</a></h1><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>This document will instruct you on configuring and managing your Autotask integration.</p><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><p>An active ImmyBot subscription or <a href="https://www.immy.bot/pricing/" target="_blank" rel="noreferrer">trial</a></p><p>MSP Admin permissions to your ImmyBot Tenant</p><p>Admin permissions to your Autotask instance</p><h2 id="process" tabindex="-1">Process <a class="header-anchor" href="#process" aria-label="Permalink to &quot;Process&quot;">​</a></h2><h3 id="create-api-user-in-autotask" tabindex="-1">Create API user in Autotask <a class="header-anchor" href="#create-api-user-in-autotask" aria-label="Permalink to &quot;Create API user in Autotask&quot;">​</a></h3><ol><li>Log in to Autotask.</li><li>Go to: Features &amp; Settings &gt; Account Settings &amp; Users &gt; Resources/Users (HR) &gt; Resources/Users &gt; New &gt; New API User.</li><li>Enter values for the First Name, Last Name, and Email Address fields.</li><li>Make a selection in the Security Level field, we have confirmed that System User works.</li><li>Use the Generate... button associated with the Username and Password fields to automatically populate the fields. <ul><li>Make note of this before exiting the window, it will only be shown once.</li><li>If you choose to create your own entries for these fields:</li><li>The username must contain letters and numbers, may contain special characters (@ ( ) ; : [ ] | \\ are not allowed), and must be unique for your database (including inactive resources).</li><li>The password must match the criteria configured in the system settings for your Autotask Site Setup.</li></ul></li><li>Select Integration Vendor radial button under API Tracking Identifier.</li><li>Select ImmyBot under the Integration Vendor dropdown</li><li>Click Save &amp; Close.</li></ol><h3 id="create-integration-in-immybot" tabindex="-1">Create Integration in ImmyBot <a class="header-anchor" href="#create-integration-in-immybot" aria-label="Permalink to &quot;Create Integration in ImmyBot&quot;">​</a></h3><ol><li>Navigate to <code>Show More</code> -&gt; <code>Integrations</code></li><li>Click add integration</li><li>Click Autotask</li><li>Name your integration</li><li>Input the username and secret for your API user</li><li>Leave IntegrationCode default, do not put anything in that field</li><li>Click update</li><li>Toggle your capabilities (see below for more information)</li><li>Toggle the enable integration switch</li><li>Review your clients in Autotask and link to your ImmyBot tenants</li></ol><h3 id="capabilities" tabindex="-1">Capabilities <a class="header-anchor" href="#capabilities" aria-label="Permalink to &quot;Capabilities&quot;">​</a></h3><ul><li>Mapping clients from the integration to tenants in ImmyBot</li><li>Retrieving client groups and clients in groups</li></ul><h3 id="migrating-your-autotask-api-user" tabindex="-1">Migrating your Autotask API User <a class="header-anchor" href="#migrating-your-autotask-api-user" aria-label="Permalink to &quot;Migrating your Autotask API User&quot;">​</a></h3><p>In October 2025, ImmyBot completed the approval process for an official integration with Autotask. Please follow this process if you had the Autotask integration set up prior to October 15, 2025 and you created a custom Integration Identifier.</p><div class="warning custom-block"><p class="custom-block-title">Migration Deadline</p><p>This migration needs to be completed by November 30, 2025. On December 1, 2025, ImmyBot will update the Autotask integration to hard code the approved code and your integration will break if it has not been migrated per the instructions below.</p><p>Update: The integration has been updated. If your integration is broken and you have not followed the steps to migrate, please do so.</p></div><ol><li>Follow the above steps to create a new API user. You cannot reuse your old API User</li><li>Navigate to your integration in your ImmyBot instance <ol><li><code>Show More</code> -&gt; <code>Integrations</code> -&gt; <code>Edit your integration</code></li></ol></li><li>Update your API Username and Password</li><li>Click update and toggle the enabled switch to force the integration to refresh and start using your new API user.</li></ol><p><br><br><br></p><div class="note custom-block github-alert"><p class="custom-block-title">Document information</p><p>Author: Mark Gomez <br> Date Published: 9/30/2025 <br> Date Revised: 10/20/2025 <br> Version Number: 1.1</p></div>',20)]))}const p=t(r,[["render",n]]);export{m as __pageData,p as default};
